import React from 'react';
import logo from '../../image/logo6.png';


function HomeComponent(props) {

    return (
        <React.Fragment>
            <div className="">
                <div><img src={logo} alt='логотип компании' /></div>
                <div>Добро пожаловать!</div>

                </div>
        </React.Fragment>
    )
}

export default HomeComponent
